FeedPackage.Description:
#ACR Xplat Settings Plugin for Xamarin and Windows
##To use, simply call:

    var int1 = Settings.Instance.Get<int>("Key");
    var int2 = Settings.Instance.Get<int?>("Key");

    Settings.Instance.Set("Key", AnyObject); // converts to JSON
    var obj = Settings.Instance.Get<AnyObject>("Key");

##To supply your own implementation:

    Settings.Instance = new YourImplementationInheritingISettings();


##Monitor setting changes:

    Settings.Changed += (sender, args) => {
        Console.WriteLine(args.Action);
        Console.WriteLine(args.Key);
        Console.WriteLine(args.Value);
    };

###In your platform project (NOT YOUR PCL)
####For DI:

    container.RegisterSingleton<ISettings, SettingsImpl>();

####For MvvmCross:

    Mvx.RegisterSingleton<ISettings, SettingsImpl>();

Allows for messagebox style dialogs to be called from your shared/PCL/MVVM code
- Action Sheet (multiple choice menu)
- Alert
- Confirm
- Loading
- Login
- Progress
- Prompt
- Toast

To initialize:
iOS AppDelegate: UserDialogs.Init();
WinPhone8: MainPage or App, UserDialogs.Init();
Android Xamarin Forms: UserDialogs.Init(() => BarCodes.Init(() => (Activity)Forms.Context);
Android MvvmCross: UserDialogs.Init(() => BarCodes.Init(() => Mvx.Resolve<ITopActivity>.TopActivity;
Android Manually: UserDialogs.Init(Activity Factory Function);

